	/// <summary>
	/// Represents a DataMiner user-defined API.
	/// </summary>
	public class Script
	{
		/// <summary>
		/// The API trigger.
		/// </summary>
		/// <param name="engine">Link with SLAutomation process.</param>
		/// <param name="requestData">Holds the API request data.</param>
		/// <returns>An object with the script API output data.</returns>
		[AutomationEntryPoint(AutomationEntryPointType.Types.OnApiTrigger)]
		public ApiTriggerOutput OnApiTrigger(IEngine engine, ApiTriggerInput requestData)
		{
			if (requestData.QueryParameters.TryGetValue("content", out string content))
			{
				switch (content)
				{
					case "latestquotes":
						return BuildLatestQuotesOutput();
					case "latestlistings":
						return BuildLatestListingsOutput();
					case "categories":
						return BuildCategoriesOutput();
					case "category":
						return BuildCategoryOutput(requestData);
					default:
						return new ApiTriggerOutput
						{
							ResponseBody = $"Bad Request - Unexpected Content Parameter: {content}",
							ResponseCode = (int)StatusCode.BadRequest,
						};
				}
			}
			else
			{
				return new ApiTriggerOutput
				{
					ResponseBody = "Bad Request - Missing Content Parameter",
					ResponseCode = (int)StatusCode.BadRequest,
				};
			}
		}

